                    var ele = $(this);

                });
                elem.toggle(function(){

        function elem_on(ele){

        function elem_off(ele){
            if(ele.data('stayon')) return;
            var graph = ele.data('graph');
            if(graph != undefined) graph.attr('stroke', '#000');
            ele.css('background-color', '#FFF');
        }
        function draw_graph(elem){
            // given a jquery obj that has it's points, graph it on paper
            pts = elem.data('points');
            pth = '';
            got_nan = false;
            for(var i = 0; i < pts.length; i++){
                for(var j = 0; j < pts[i].length; j++){
                    if(isNaN(pts[i][j])){
                        got_nan = true;
                        break;
                    }
                }
                if(got_nan) break;
                if(i == 0) pth += "M" + pts[i];
                else pth += "L" + pts[i];

            if(!got_nan){
                elem.data('graph', paper.path(pth));
            }

        }
        function dat_to_points(dt_arr){
            // for each point figure out an x/y based on the dt/mem max/min

                var y = map(in_mem, mem_min, mem_max, HEIGHT, 0);
                ret.push([x, y]);
            }
            return ret;
        }
